Psalm 21 (2009) 

In Stockholm, the priest Henrik Horneus is beloved by his parish flock, and in his sermon, he frequently mentions the Psalm 21 that is the favorite of his father and also priest Gabriel that lives in Hammerdal. Henrik has relationship problems with his son Jesper that lives with his mother Elsie and is spending his birthday with him. When Jesper is ready to go home with his mother, Henrik's girlfriend Karolina receives a phone call from the coroner of Hammerdal telling that his estranged father has been found drowned in the Dead Lake. Henrik decides to drive alone in the middle of the night to his father's hometown to attend the funeral and learn what has happened to him. Out of the blue, a person appears on the dark road and Henrik runs over her. Henrik pulls the car over but he does not see anybody on the road. Henrik returns to the car but it does not start, so he walks to a small farm to ask for help...   

